import React from 'react';

interface Chat {
  name: string;
  message: string;
  time: string;
  avatar: string;
  status: string; // Added status field
}

interface MessageSystemProps {
  chat: Chat | null;
}

const MessageSystem: React.FC<MessageSystemProps> = ({ chat }) => {
  if (!chat) {
    return (
      <div className="flex-grow mb-4 p-4 ml-64 mt-20 flex flex-col h-[calc(100vh-5rem)]">
        <div className="flex justify-between items-center mb-4">
          <div className="text-xl font-[700] mb-5 text-[#232323] flex items-center space-x-2">
            <span>Select a chat to see messages.</span>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="flex-grow mb-4 flex flex-col h-[calc(100vh-5rem)]">
      {/* Header with chat information */}
      <div className="flex justify-between items-center mb-4">
        <div className="text-xl font-[700] text-[#232323] flex items-center space-x-2">
          <img className="w-12 h-12 rounded-full" src={chat.avatar} alt={chat.name} />
          <div>
            <span>{chat.name}</span>
            <div className={`text-xs ${chat.status === 'Online' ? 'text-green-500' : 'text-gray-500'}`}>
              {chat.status}
            </div>
          </div>
        </div>
      </div>

      {/* Message area */}
      <div className="flex flex-col flex-grow overflow-hidden bg-[#f6f6f8]">
        {/* Example message entries */}
        <div className="flex ml-10 mr-5 mb-4">
          <img src={chat.avatar} alt={chat.name} className="w-10 h-10 rounded-full mt-8 mr-2" />
          <div className='ml-5'>
            <p className="bg-white p-2 w-[490px] h-[70px] rounded-lg shadow-md">
              {chat.message}
              <span className="text-xs text-gray-500 float-right" style={{ position: 'relative', top: '-5px', marginRight: '10px' }}>
                {chat.time}
              </span>
            </p>
          </div>
        </div>
        {/* More messages can be added here */}

        {/* Right-aligned messages */}
        <div className="flex justify-end ml-24 mb-4">
          <div className='mr-5'>
            <p className="bg-white p-2 w-[490px] text-xs h-[70px] rounded-lg shadow-md">
              Lorem ipsum Lorem Sit Amet, Connector Aditi Sit,
              <p>Nasfam Additij</p>
              <span className="text-xs text-gray-500 float-right" style={{ position: 'relative', top: '-5px', marginRight: '10px' }}>12:09 PM</span>
            </p>
          </div>
          <img src={chat.avatar} alt={chat.name} className="w-10 h-10 rounded-full mt-8 mr-2" />
        </div>
        <div className="flex justify-end ml-24 mb-4">
          <div className='mr-5'>
            <p className="bg-white text-xs p-2 w-[490px] h-[70px] rounded-lg shadow-md">
              Lorem ipsum Lorem Sit Amet, Connector Aditi Sit,
              <p>Nasfam Additij</p>
              <span className="text-xs text-gray-500 float-right" style={{ position: 'relative', top: '-5px', marginRight: '10px' }}>12:09 PM</span>
            </p>
          </div>
          <img src={chat.avatar} alt={chat.name} className="w-10 h-10 rounded-full mt-8 mr-2" />
        </div>
      </div>

      {/* Input area */}
      <div className="flex items-center mb-4 p-4 border-t bg-[#ffffff] shadow-md">
        <img className="p-2 mr-2 bg-white w-10 h-10" src="/assets/add.svg" alt="Plus" />
        <span className="text-xs font-medium text-gray-400 flex-grow">Type Here</span>
        <img className="p-2 bg-white w-14 h-14" src="/assets/sendbutton.svg" alt="Send" />
      </div>
    </div>
  );
};

export default MessageSystem;
